  [],\n\t\"revision_timestamp\": \"2015-05-07T03:28:58.894275\",\n\t\"name\": \"high-energy-density-lithium-air-batteries-for-oxygen-concentrators-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"For NASA's Exploration Medical Capabilities
  mission, extremely highnspecific energy power sources, with specific energy over
  2000 Wh/kg, arenurgently sought after. Such battery can be used to power the mobilenoxygen
  concentrators. Current primary lithium batteries, such as Li/SO2nsystem, Li/CFx
  system, and fuel cells, have limited specific energy tonaround 500 Wh/kg.  Lithium
  air cell has over 11500 Wh/kg theoreticalnspecific energy, so it holds the great
  potential to realize suchnchallenging goals. However, the state-of-the-art lithium
  air batteryndevelopment has encountered several technical difficulties, includingnair
  cathode performance, air management and cell packaging preventnDriven by the strong
  market pull for this technology, Bettergy hasnconducted preliminary investigation
  into solutions to those problems.nBased on our extensive experience in the field
  of metal air technology,nwe have come up with several innovative solutions. Initial
  results arenvery promising. With the support of this SBIR program, we will furthernimplement
  and test our unique concepts in order to realize the fullnpotential of the lithium
  air system.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
